import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link} from "react-router-dom";


class Empheader extends React.Component {
    render() {
        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div >
                        <Link to="/employee"> <img style={{float:"left"}} onclick={window.location.reload()}  src={NINE} alt="nineleaps"/> </Link>
                           <Link to = "/logout" style={{float:"right"}} >Logout</Link>
                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Empheader
